<script>
import Card from '~/components/Card.vue'
import Layanan from '~/components/layanan.vue'

export default {
  name: 'IndexPage',
  data() {
    return {
      banner: false,
      paketDataParam: 'paketData',
      pulsaParam: 'pulsa',
      cashoutParam: 'cashout',
      emoneyParam: 'emoney',
    }
  },

  computed: {
    getUser() {
      return this.$store.state.userAuth.User
    },
    getLevel() {
      return this.$store.state.userAuth.id
    },

    pulsa() {
      return this.$store.state.product.product.filter((el) => {
        return el.type_product === 'Pulsa'
      })
    },
    cashout() {
      return this.$store.state.product.product.filter((el) => {
        return el.type_product === 'Cashout'
      })
    },
    emoney() {
      return this.$store.state.product.product.filter((el) => {
        return el.type_product === 'E-Money'
      })
    },

    product() {
      return this.$store.state.product.product.filter((el) => {
        return el.type_product === 'Paket Data'
      })
    },
  },
  methods: {
    showAllBenefit(prodType) {
      this.$router.push({
        name: 'User-product-productType',
        params: {
          productType: prodType,
        },
      })
    },

    toDetail(idx) {
      this.$router.push({
        name: 'User-product-detail-tukar',
        params: {
          index: idx,
        },
      })
    },
  },
  created() {
    if (this.$cookies.get('token')) {
      const tokens = this.$store.state.userAuth.token
      const ids = this.$store.state.userAuth.id
      this.$store.dispatch('userAuth/fetchUser', {
        token: tokens,
        id: ids,
      })
    }

    this.$store.dispatch('product/fetchProduct')
  },
  components: { Card, Layanan },
}
</script>
